import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import * as Pages from "./pages";
import * as Templates from "./templates";

const App = () => {
  return (
    <Router>
      <Routes>
        <Route
          exact
          path="/"
          render={(props) => (
            <Templates.BaseTemplate {...props}>
              <Pages.Teams {...props} />
            </Templates.BaseTemplate>
          )}
        />
      </Routes>
    </Router>
  );
};

export default App;
